  false,\n\t\"url\": null,\n\t\"notes\": \"This linear feature class depicts the boundaries
  of the livestock grazing pastures located within the Idaho BLM, Idaho, USA. A pasture
  is a sub-unit of a grazing allotment, each allotment is comprised of at least one
  pasture. In some cases, this layer identifies the BLM managed public land or other
  land associated with specific grazing Allotments administered by the local BLM field
  office. Boundaries may be fences, arbitrary lines, or natural barriers. Agency management
  of polygons within this coverage is not specific to BLM; other agencies are also
  included.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
